import React from "react";
import web from "../src/images/web1.jpg";

export const About =()=>{
    return(
        <>
        <section id="header" className="">
           
           
                
                <div >
                <img src={web}  alt="..." width="1400" height="200" />
                   
                   </div>
                <div className="row">
                  
                   
                   <h3 className="my-3">Founded in 2000, Pratham Software (PSI) operates today as a global provider of software solutions for various segments including OPD, BPM, ADM, ISV, Web &
                    Multimedia, Testing, and Consulting Services. From our offices in the US, Canada, and Germany, and a development center in India, we serve an extremely diverse base of industry and technology clients, 
                   from startups to Fortune 500 corporations.</h3>
                   <div className="my-3">
                   <a href="" className=" btn-get-started ">get started</a>
                    
                   </div>
                   
                  
                   </div>
              
             
        
           </section>
        </>
    )
    

};

export default About;
